import { useState, useEffect } from 'react';
import Web3 from 'web3';
import abi from '';

  const wei = 0.000000000000000001;
  const Wei = 1000000000000000000;
  const Chains = {
    1: "Mainnet",
    3: "Ropsten",
    4: "Rinkeby",
    5: "Goerli",
    42: "Kovan",
    1337: "Geth private chain(default )",
    61: "Ethereum Classic Mainnet",
    62: "Morden",
    80001: "PolygonMumbai"
  }

const getAccount = async () => {
    try {
        const account = await window.ethereum.request({ method: 'eth_requestAccounts' });
        if (account.length > 0) {
            return account[0];
        } else {
            return "";
        }
    } catch (err) {
        if (err.code === 4001) {
            // EIP-1193 userRejectedRequest error
            // If this happens, the user rejected the connection request.
            console.log('Please connect to MetaMask.');
        } else {
            console.error(err);
        }
        return "";
    }
}

const handleAccountChanged = async (accountNo, setAccount, setChainId, setWeb3) => {
    const account = await getAccount();
    setAccount(account);

    const chainId = await getChainID();
    setChainId(chainId);

    setWeb3(new Web3(window.ethereum));

}

const getChainID = async () => {
    const chainId = await window.ethereum.request({ method: 'eth_chainId' });
    return parseInt(chainId);
}


function Viewer() {
    const [account, setAccount] = useState("-");
    const [chainId, setChainId] = useState(0);
    const [balance, setBalance] = useState();
    const [address, setAddress] = useState();
    const [tokenId, setTokenId] = useState();
    const [collection, setCollection] = useState("-");
    const [contract, setContract] = useState(null);
    const [web3, setWeb3] = useState(null);
    const btnDisabled = account != "-";

    const initializeAccount = async () => {
        const account = getAccount();
        if (account != "") {
            handleAccountChanged(account, setAccount, setChainId, setWeb3);
        }
    };

    const getBalance = async () => {
        const amount = await window.ethereum.request({
        method: 'eth_getBalance',
        params: [account,'latest']
        });
        console.log(amount);
        setBalance(parseInt(amount) * wei);
    }

    const getCollection = async () => {
        const contractAddress = "0x4AAbbb31f44941eFAd14f019Efe876916b57a293";
        const contract = new web3.eth.Contract(abi, contractAddress);
        const message = await contract.methods.tokenMessage(tokenId).call();
	setCollection(message);
	const tran = contract.getTransaction();
	console.log("FINISH");
    }

    useEffect(() => {
        if (typeof window.ethereum !== 'undefined') {
            window.ethereum.on("accountsChanged", (accountNo) => handleAccountChanged(accountNo, setAccount, setChainId));
            window.ethereum.on("chainChanged", (accountNo) => handleAccountChanged(accountNo, setAccount, setChainId));
        }
    }, [account]);

return(
    <>
    <h1>NFT確認</h1>
    <div>
      <h2>Account</h2>
      <button id="GetAccountButton" onClick={initializeAccount} disabled={btnDisabled}>Get Account</button>
      <p id="account">Address:{account}</p>
      <p id="account">ChainID:{chainId}</p>
      <p id="account">ChainName:{Chains[chainId]}</p>
    </div>
    <div>
      <button id="GetBalance" onClick={getBalance} enabled={btnDisabled}>Get Balance</button>
      <p id="account">Balance:{balance}</p>
    </div>
    <div>
      NFTAddress:<input type="text" name="address" value={address} onChange={(e) => setAddress(e.target.value)} /><br/>
      TokenId:<input type="text" name="tokenId" value={tokenId} onChange={(e) => setTokenId(e.target.value)} /><br/>
      <button id="getColection" onClick={getCollection} enabled={btnDisabled}>GetCollection</button><br/>
      Collection:{collection}
    </div>
    <div>
        <a href="/">戻る</a>
    </div>
    </>
  );
};

export default Viewer;
